function getStateResults(state) {
    // Return a list of every election result for the given state
    // TODO: IMPLEMENT THIS
    let returnVal = [];
    let data = PRESIDENT_DATA["years"]
    for (let year = MIN_YEAR; year <= MAX_YEAR; year += 4) {
        let yearData = data[year]["states"]
        if (state in yearData) {
            returnVal.push(yearData[state])
        } else {
            console.error("State not found: " + state)
            returnVal.push(null)
        }

    }

    return returnVal;

}